pragma solidity  >=0.5.0 <0.8.0;

contract A{

uint public a;
constructor(){
a=100;
}

function funA() public {
 a=10;

}
function fun() public pure virtual returns( string memory){

    return " i am in contract A ";

}

}



contract B is A{

uint public b;
constructor(){
b=100;
a=50;
}

function funB() public {
 b=20;

}
function fun() public pure virtual override returns( string memory){

    return " i am in contract B ";
// if we want to use fun function of contract a than 
}

}

contract C is A,B{
// override ( A,B ) me ye function kis kis contract me hai likhna hota hai and sequence metter nahi karta
